import React from "react";

const Login = () => {
    const rappers = ['Travis Scott', 'Lil Uzi Vert', 'Playboi Carti', 'Gunna'];
    const listItems = rappers.map(item => <li> {item} </li>);

    return (
        <div>
            <h1>{listItems}</h1>
        </div>
    );
};

export default Login;
